import React from 'react';
import { Form, Button, FormCheckbox } from 'semantic-ui-react';

function AccountPrivacySettingsTab({ userMe, setModalOpen }) {
  return (
    <Form>
      <Form.Field>
        <label>Email</label>
        <input placeholder='' />
      </Form.Field>
      <Form.Field>
        <FormCheckbox label='Присылать уведомления по Email' />
      </Form.Field>
      <Form.Field>
        <label>Номер телефона</label>
        <input placeholder='' />
      </Form.Field>
      <Form.Field>
        <a href="#" onClick={() => setModalOpen(true)}>Изменение пароля</a>
      </Form.Field>
      <Button>Применить</Button>
    </Form>
  );
}

export default AccountPrivacySettingsTab;
